import { useDispatch } from 'react-redux';
import Styles from './components/Styles/Styles'
import Form from './components/Form/Form'
import { Container } from '@mantine/core';

const App = () => {
  const dispatch = useDispatch();
  return (
    <div>
      <Container>
      <h1>OnStyles</h1>
      <Styles />
      </Container>
    </div>
  )
}

export default App
